import React, { Component,useState,useEffect } from "react";
// import MyNavbar from "./components/my-navbar/my-navbar.component";
import MyNavbar from "../../components/my-navbar/my-navbar.component";
import MyCarousal from "../../components/my-carousal/my-carousal.component";
import MyTitleMessage from "../../components/title-message/title-message.component";
// import About from "./pages/about/about.component";
// import Skills from "./pages/skills/skills.component";
import Container from "react-bootstrap/Container";
import TimeLine from "../../components/projects-timeline/projects-timeline.component";
// import Experience from "./pages/experience/experience.component";
import Fade from "react-reveal/Fade";
// import ContactForm from "./pages/contact-form/contact-form.component";
import { Parallax } from "react-parallax";

import FooterPanel from "../../components/footer/footer.component";

import World from "../../assests/video/World-1992.mp4";
// import { Dimensions } from 'react-native';
import heroSection from "../../components/heroSection/heroSection";
//profile Picture
import ExampleComponent from "react-rounded-image";
import profilePictureImage from '../../assests/img/profile/linkedin-photo.jfif';
import styles from  './home.module.css';
import profilePicture from "../../components/profilePicture/profilePicture.component";



class Home extends Component {
    // Window Size
    constructor(props) {
        super(props);
        this.state = { height: props.height, width: props.width };

    }
    componentWillMount(){
        this.setState({height: window.innerHeight + 'px',width: window.innerWidth + 'px'});
    }
    render() {
        return (
            <div className={styles.Home}>
                <MyCarousal />
                    <div className={styles.Content}>
                        <ExampleComponent
                            image={profilePictureImage}
                            roundedColor="#FFF"
                            imageWidth="150"
                            imageHeight="150"
                            roundedSize="10"
                        />
                    </div>
                    
                    reactDOM.render(<profilePicture />);
                        <MyTitleMessage />



            </div>
        );
    }
}

export default Home;
